{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/pavanrahulk/bellabeat-case-study-r?scriptVersionId=136462663\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"e97d1df2","metadata":{"papermill":{"duration":0.013637,"end_time":"2023-07-11T17:44:49.884617","exception":false,"start_time":"2023-07-11T17:44:49.87098","status":"completed"},"tags":[]},"source":["![](https://upload.wikimedia.org/wikipedia/commons/2/24/Bellabeatlogo.png)"]},{"cell_type":"markdown","id":"9ac5867a","metadata":{"papermill":{"duration":0.012016,"end_time":"2023-07-11T17:44:49.90928","exception":false,"start_time":"2023-07-11T17:44:49.897264","status":"completed"},"tags":[]},"source":["# About Company \n","Bellabeat is a data-centerd fem-tech company founded in 2013,which will be targeting in a global-health conisious communities.Throughout the years, Bellabeat built the go-to wellness brand for women with a compelling ecosystem of solutions and services focused on women’s health.It foucses on Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women withknowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly one positioned itself as a tech-driven wellness company for women.<br>\n","\n","   By 2016, Bellabeat products became available through a growing number of online retailers in addition to their own e-commerce channel on their website.So, it mainly focuses on digital marketing extensively, including Google Search, video ads, and consumer engagement on social media platforms.Additionally, it runs video ads on Youtube and display ads on the Google Display Network to support campaigns around key marketing dates.\n","\n","● Products:<br>\n","○ **Bellabeat app:** The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.<br>\n","○ **Leaf:** Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.<br>\n","○ **Time:** This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.<br>\n","○ **Spring:** This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.<br>\n","○ **Bellabeat membership:** Bellabeat also offers a subscription-based membership program for users.Membership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and beauty, and mindfulness based on their lifestyle and goals."]},{"cell_type":"markdown","id":"dae241cb","metadata":{"papermill":{"duration":0.012553,"end_time":"2023-07-11T17:44:49.933376","exception":false,"start_time":"2023-07-11T17:44:49.920823","status":"completed"},"tags":[]},"source":["# Ask phase\n","##### Business Task:\n","As a data analyst working on the marketing analyst team, I will analyze smart device data to gain insights and trends on how consumers are using their smart fitness devices, and focus on one of Bellabeat's products. Identify key findings and trends from the analysis and recomendations are done according to the findings to the stakeholders which will influence in their marketing strategy.<br>\n","##### StakeHolders:\n","* Urška Sršen: cofounder and Chief Creative Officer.\n","\n","* Sando Mur: cofounder and a key member of the Bellabeat executive team.\n","\n","* Bellabeat marketing analytics team."]},{"cell_type":"markdown","id":"09b7cf4e","metadata":{"papermill":{"duration":0.012627,"end_time":"2023-07-11T17:44:49.958125","exception":false,"start_time":"2023-07-11T17:44:49.945498","status":"completed"},"tags":[]},"source":["# Prepare phase\n","In this Analysis we are going to use one of the most famous datasets:[**Fitbit Fitness Tracker Data**](http://https://www.kaggle.com/datasets/arashnic/fitbit). which contains 18csv files of different data collected from around 30 eligible users which contains the submission of their personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring.<br>\n","\n","Datasets used for our anlaysis:<br>\n","* Y dailyActivity_merged.csv\n","* NA dailyCalories_merged.csv\n","* NA dailyIntensities_merged.csv\n","* NA dailySteps_merged.csv\n","* Y sleepDay_merged-edit.csv\n","<br>\n","\n","#### Tools Used\n","This is purely an R implementation, from data preparation, processing, cleaning, transformation, analysis, and visualization, and documentation."]},{"cell_type":"markdown","id":"5d71f1b5","metadata":{"papermill":{"duration":0.012145,"end_time":"2023-07-11T17:44:49.984562","exception":false,"start_time":"2023-07-11T17:44:49.972417","status":"completed"},"tags":[]},"source":["#### loading packages"]},{"cell_type":"code","execution_count":1,"id":"b07fe042","metadata":{"_kg_hide-input":false,"_kg_hide-output":true,"execution":{"iopub.execute_input":"2023-07-11T17:44:50.012624Z","iopub.status.busy":"2023-07-11T17:44:50.009895Z","iopub.status.idle":"2023-07-11T17:44:52.498996Z","shell.execute_reply":"2023-07-11T17:44:52.496505Z"},"papermill":{"duration":2.507255,"end_time":"2023-07-11T17:44:52.503399","exception":false,"start_time":"2023-07-11T17:44:49.996144","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ────────────────────