s":[]},"source":["#####  **Intersting findings from the Summary:**<br>\n","* Avg steps per day is 7652 and Avg distance covered is around 5.6 kilometers . According to  Centers for Disease Control and Prevention (CDC), a person should cover around 10k steps per day .For most people, this is the equivalent of about 8 kilometers.<br>\n","* Most of the participants are  lightly active.\n","* On a avg a person spends 227.87 minutes (i.e around 3.7hrs) on some activies and spends most of the time seated.Avg time a person spends seated is 990.4 minutes (i.e 16.5hrs) which more than half of a day which is not a good for health.              <br>More recent observational studies comparing workers who sit for long periods against those who sit for fewer hours have found that sedentary workers have more than twice the risk of developing type 2 diabetes and cardiovascular disease, a 13 percent increased risk of cancer and 17 percent increased risk of dying.\n","* Avg time asleep is around 419.5 minutes(i.e around 6.9hr) which is normal."]},{"cell_type":"markdown","id":"debaa8e6","metadata":{"papermill":{"duration":0.017042,"end_time":"2023-07-11T17:44:54.063862","exception":false,"start_time":"2023-07-11T17:44:54.04682","status":"completed"},"tags":[]},"source":["### Visualizations"]},{"cell_type":"markdown","id":"04c46849","metadata":{"papermill":{"duration":0.017196,"end_time":"2023-07-11T17:44:54.097994","exception":false,"start_time":"2023-07-11T17:44:54.080798","status":"completed"},"tags":[]},"source":["##### Total Steps Vs Distance Covered\n"]},{"cell_type":"code","execution_count":8,"id":"f82df075","metadata":{"execution":{"iopub.execute_input":"2023-07-11T17:44:54.138742Z","iopub.status.busy":"2023-07-11T17:44:54.13669Z","iopub.status.idle":"2023-07-11T17:44:56.826866Z","shell.execute_reply":"2023-07-11T17:44:56.824379Z"},"papermill":{"duration":2.714534,"end_time":"2023-07-11T17:44:56.830595","exception":false,"start_time":"2023-07-11T17:44:54.116061","status":"compl