"end_time":"2023-07-11T17:45:02.894472","exception":false,"start_time":"2023-07-11T17:45:02.86526","status":"completed"},"tags":[]},"source":["**Recommendations From the Analysis** <br>\n","\n","\n","\n"," * It has been observed that avg amount of steps ins around 7.6k per day which is not enough according to the CDC.  It recommends to take atleast **10k** steps each day.So,we can find a way to motivate users to reach the goal.<br> Like we can add a **leaderboard** where a list of friends can track eachothers goals. Also, adding features like some competitions/a weekly challengs, or some mini-games where they can compete with their friends. \n","\n","* We can also notify the user to to get enough sleep from their sleep activity .\n","\n","* As most of the user's tend to spend more time seated, we can add a reminder which tell the user to go for a small 2mins walk.After they finish the walk they can continue their work.\n","\n","* Adding features like recommending some  diet-plans,workout-plans based on the user's interset, which may help users to lead a healthier lifestyle.\n"]},{"cell_type":"code","execution_count":null,"id":"0d54f680","metadata":{"papermill":{"duration":0.02882,"end_time":"2023-07-11T17:45:02.952304","exception":false,"start_time":"2023-07-11T17:45:02.923484","status":"completed"},"tags":[]},"outputs":[],"source":[]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":17.922159,"end_time":"2023-07-11T17:45:03.108005","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-07-11T17:44:45.185846","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}